    false,nt"url": null,nt"notes": "Geologic map of Washington--Northeast quadrant,
    Geologic Map GM-39. The Geologic Map of Washington - Northeast Quadrant is the second
    in a series of four 1:250,000-scale geologic maps, which together will make up the
    third geologic map of Washington published by the Washington Division of Geology
    and Earth Resources and its predecessors. The Geologic Map of Washington - Southwest
    Quadrant, the first map in the series, is available as Washington Division of Geology
    and Earth Resources Geologic Map GM-34 (Walsh and others, 1987). The remaining two
    maps in the series, the Geologic Map of Washington - Southeast Quadrant and the
    GeologicnMap of Washington - Northwest Quadrant, are currently in preparation (May
